import React, { useState } from "react";
import "./App.css";

function App() {
  const [data, setData] = useState({});

  function test() {
    async function fetchData() {
      const response = await fetch("http://localhost:3000/forsinkelser");
      const json = await response;
      setData(json);
    }
    fetchData();
  }
  return (
    <div className="App">
      <button onClick={test()}>TEST</button>
    </div>
  );
}

export default App;
